import React from "react";
import { Link } from "react-router-dom";

const About = () => {
  return (
    <>
      <nav>
        <h1>Hii This is About page</h1>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/about">About</Link>
          </li>
          <li>
            <Link to="/conatct">Conatct</Link>
          </li>
          <li>
            <Link to="/account">Account</Link>
          </li>
        </ul>
      </nav>
    </>
  );
};

export default About;
